text:
@KashPrime @TheReSisters2 I am SO GRATEFUL for #CovidVaccine.
My kid (35, vax x3) caught it in April and she's still sick. Dizzy and incredible fatigue! e.g. After standing in the kitchen cutting veggies for supper, she had to rest for a couple of hours.
I don't dare imagine if she'd caught it before.
